import moment from 'moment'

const gamecategories = [
    {
        title: 'Single Player',
        date: moment().format('MMMM DD, YYYY'),
        categories: ['Single Player'],
        link: '#',
        image: 'singleplayer.jpg',
    },
    {
        title: 'Multiplayer',
        date: moment().format('MMMM DD, YYYY'),
        categories: ['Multiplayer'],
        link: '#',
        image: 'multiplayer.jpg',
    },
    {
        title: 'Co-Op',
        date: moment().format('MMMM DD, YYYY'),
        categories: ['Co-Op'],
        link: '#',
        image: 'coop.jpg'
    },
    {
        title: 'Upcoming',
        date: moment().format('MMMM DD, YYYY'),
        categories: ['Multiplayer', 'Upcoming'],
        link: '#',
        image: 'upcoming.jpg'
    },
]
export default gamecategories;
